import './App.css';

import { useState } from 'react';

import Axios from 'axios'

function App() {

  const[name,setName]=useState(""); 

  const[contactnumber,setcontactnumber]=useState(0); 

  const[country,setCountry]=useState(""); 

  const[clinicaddress,setClinicaddress]=useState(""); 

  const[salary,setSalary]=useState(0); 

  const [newSalary,setNewSalary] = useState(0);


  const [employeeList,setEmployeeList]=useState([]);



const addEmployee=()=>{



  Axios.post('http://localhost:3001/create',
  {
 name:name,
 contactnumber:contactnumber,
 country:country,
 clinicaddress:clinicaddress,
 salary:salary,

}).then(()=>{
  setEmployeeList([...employeeList,

    {
      name:name,
      contactnumber:contactnumber,
      country:country,
      clinicaddress:clinicaddress,
      salary:salary,

     },

  ])
});

};

const getEmployees =()=>{

  Axios.get('http://localhost:3001/employees').then((response)=>{
  setEmployeeList(response.data );
});


};

const updateEmployeeSalary=(id)=>{
  Axios.put('http://localhost:3001/update',{salary:newSalary,id:id}).then((response)=>{
    setEmployeeList(employeeList.map((val)=>{
      return val.id== id ?
      {id:val.id,name:val.name,country:val.country,contactnumber:val.contactnumber,clinicaddress:val.clinicaddress,salary:newSalary}:val
    }))
  })
};

const deleteEmployee=(id)=>{
  Axios.delete(`http://localhost:3001/delete/${id}`).then((response)=>{
    setEmployeeList(employeeList.filter((val)=>{
      return val.id!=id
    }))
  })
}

  return (



    <div className="App">





    <div className='information'>


    <nav>
      <img src="FIRST_MEDIX_LOGO.png" alt="logo" />
    </nav>

    <label>Clinic Name</label>
      <input type="text" onChange={(event)=>{setName(event.target.value);
      }}

      placeholder='Enter Clinic Name'
       />

    <label>Contact Number</label>
      <input type="number" 
      onChange={(event)=>{setcontactnumber(event.target.value);
      }}
       />

    <label>Country</label>
      <input type="text"
      onChange={(event)=>{setCountry(event.target.value);
      }}
       />

    <label>Clinic Address</label>
      <input type="text"
      onChange={(event)=>{setClinicaddress(event.target.value);
      }}
       />

    <label>Salary(Year)</label>
      <input type="number"
onChange={(event)=>{setSalary(event.target.value);
      }}

       />
      <button onClick={addEmployee}>Add Clinic</button>
    </div>


<div className="employees">
      <button onClick={getEmployees}>Show Clinics</button>


      {employeeList.map((val,key)=>{
        return (

         <div className='employee'> 

        <div>
        <h3>Name: {val.name}</h3>
        <h3>Contactnumber:{val.contactnumber}</h3>
        <h3>Country: {val.country}</h3>
        <h3>Clinicaddress: {val.clinicaddress}</h3>
        <h3>Salary: {val.salary}</h3>
</div>
          <div>

          <input type="text" placeholder="2000.."

onChange={(event)=>{setNewSalary(event.target.value);
      }}

          />
          <button onClick={()=>{updateEmployeeSalary(val.id)}}>
          {""}
          Update

          </button>


      <button onClick={()=>{
        deleteEmployee(val.id);
      }}>
      Delete</button>


          </div>

         </div>
        );

      })}

      </div>

    </div>
  );
}

export default App;
